import './css/App.css';
import './helper/responsive';
import Nav from './helper/nav';
import PostForm from "./postForm";
import {
    BrowserRouter as Router,
    Redirect,
    Route,
    Switch,
} from "react-router-dom";
import { ToastContainer } from "react-toastify";

 function App() {


     return (
        <>

            {/*<PostForm />*/}
     {/*<Nav />*/}






            <Router>
                <div>
                    <ToastContainer />
                    <TopMenu />
                    <Switch>
                        <Route
                            path="/products/product_details/:id"
                            component={ProductPage}
                        ></Route>
                        <Route path="/cart/:id?" component={Cart}></Route>
                        <Route
                            path="/manageProducts/Addproduct"
                            component={Addproduct}
                        ></Route>
                        <Route
                            path="/manageProducts/Editproduct/:id"
                            component={Editproduct}
                        ></Route>

                        <Route path="/manageProducts" component={ManageProducts}></Route>
                        <Route path="/checkout" component={Checkout}></Route>

                        <Route path="/products" component={products}></Route>
                        <Route path="/contact-us" component={contactus}></Route>
                        <Route path="/notfound" component={notfound}></Route>
                        <Route path="/login" component={login}></Route>
                        <Route path="/signup" component={signup}></Route>

                        <Route path="/" exact component={Home}></Route>
                        <Redirect to="/notfound"></Redirect>
                    </Switch>
                </div>
            </Router>

        </>
  )
}
export default App;
